  \"Oceanographic and surface meteorological data collected from station U-GLOS Station
  004, Little Traverse Bay by University of Michigan and assembled by Great Lakes
  Observing System (GLOS) in the Great Lakes region from 2014-07-01 to 2015-06-30
  (NODC Accession 0123643)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
